import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text , View , Button , TextInput, ImageBackground } from 'react-native';

export default function App() {
  return (

    <ImageBackground source={require('../image/')} style ={style.sreen} >


      <View style={style.inputtext1}>
      <TextInput placeholder="nom admin" style ={{width: 200 ,padding :5, }} />
      </View>
      <View style={style.inputtext2}>
      <TextInput placeholder="mot de pass" style ={{width: 200,padding : 5}}  />
      </View>
       <View  style ={{padding: 0  , flexDirection : 'row' , justifyContent :'center'}} >
      <Button title="se connecter avec facebook" />
      </View>
      <View style ={{padding: 20 , flexDirection : 'row' , justifyContent : 'center' }} >
      <Button title="se connecter avec email "/>
      </View>

    </ImageBackground>
  );
}
const style = StyleSheet.create({
  sreen :{
    padding :200 ,
    flexDirection :'column' 
    ,justifyContent:'center'
     , alignContent :'center'
  },
inputtext1:{
  flexDirection :'row' , justifyContent:'center'
},
inputtext2 : {
  padding: 30 ,  flexDirection :'row' , justifyContent:'center' 
}

});
